webpackJsonp([46999967584902],{4033:function(e,n){e.exports={data:{markdownRemark:{html:'<h1>Switch Statement</h1>\n<p>Switch is a selection statement that chooses a switch case section depending on the value matched with the expression/value being evaluated.<sup>1</sup>  If none of the case statements match the value of the switched variable, the default path is chosen.</p>\n<h2>Example</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>public enum Colors { Red, Blue, Green, Orange }\n\nColors myColor;\n\n... myColor is set to one of the enum values ...\n\nswitch(myColor){\n  case Colors.Red: \n    Console.WriteLine("How you like them apples?");\n    break;\n  case Colors.Blue: \n    Console.WriteLine("Ice Ice Baby...");\n    break;\n  case Colors.Green: \n    Console.WriteLine("Fore!");\n    break;\n  default:\n    Console.WriteLine("I have a hard time when I try to rhyme.");\n}</code></pre>\n      </div>\n<h2>Output:</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>If myColor is Colors.Red:\n> How you like them apples?\n\nIf myColor is Colors.Blue:\n> Ice Ice Baby...\n\nIf myColor is Colors.Green:\n> Fore!\n\nIf myColor is Colors.Orange:\n> I have a hard time when I try to rhyme.</code></pre>\n      </div>\n<h3>Sources</h3>\n<p>1 <a href="https://docs.microsoft.com/en-us/dotnet/csharp/language-reference/keywords/switch">https://docs.microsoft.com/en-us/dotnet/csharp/language-reference/keywords/switch</a></p>',fields:{slug:"/csharp/switch-statement/"},frontmatter:{title:"Switch Statement"}}},pathContext:{slug:"/csharp/switch-statement/"}}}});
